import React from 'react';
import Card from 'react-bootstrap/Card';

function Cards({ item }) {
  return (
    <div className="">
      <Card>
        <img src={item.imgs[0]} alt="" />
        <Card.Body>

        </Card.Body>
      </Card>
     
    </div>
  );
}

export default Cards;
